import {initialState } from './inital';




const getdataReducer = (state = initialState.data, action) => {
    switch (action.type) {
        case "GET_POOLS_DATA":
            return {
                ...state,
                poolsData: action.data
            }
        case "GET_MEGA_DATA":
            return {
                ...state,
                megaData: action.data
            }
        default:
            return state
    }
};
export default getdataReducer;
